import React from "react";
import { Routes, Route } from "react-router-dom";
import UnauthenticatedNav from './components/Navbar/UnauthenticatedNav';
import AuthenticatedNav from './components/Navbar/AuthenticatedNav';
import Home1 from './'; // Import the Home1 component
import './components/Headers/headers.css';

const Headers = () => {
  // Check if the user is authenticated by checking the token in local storage
  const isAuthenticated = !!localStorage.getItem("token");

  return (
    <div className="menu transparent-menu">
      <div className="name">
        <h3>LOST AND FOUND SYSTEM</h3>
      </div>
      <nav className="menuitems">
        {isAuthenticated ? (
          <AuthenticatedNav />
        ) : (
          <UnauthenticatedNav />
        )}
      </nav>
    </div>
  );
};

function App() {
  return (
    <Routes>
      <Route path="/" element={<Home1 />} /> {/* Route for Home1 */}
    </Routes>
  );
}

export default App;
